INSERT INTO movies1(id, title, year) SELECT id, title, year FROM movies;
INSERT INTO genres(title) SELECT genres FROM allGenres WHERE genres != '' GROUP BY genres;
INSERT INTO genres_for_movies(movie_id, genre_id) SELECT movies.id, genres.id FROM movies JOIN genres ON instr(movies.genres, genres.title);
INSERT INTO ratings1(user_id, movie_id, rating, timestamp) SELECT user_id, movie_id, rating, timestamp FROM ratings;
INSERT INTO tag(title) SELECT DISTINCT tag FROM tags;
INSERT INTO tags1(id, user_id, movie_id, tag_id, timestamp) SELECT tags.id, tags.user_id, tags.movie_id, tag.id, tags.timestamp FROM tags JOIN tag ON tags.tag == tag.title;
INSERT INTO occupations(title) SELECT DISTINCT occupation FROM users;
INSERT INTO users1(name, surname, email, gender, register_date, occupation_id) SELECT substr(name, instr(name, ' ')+1), substr(name, 1, instr(name, ' ')-1), email, gender, register_date, occupations.id  FROM users INNER JOIN occupations ON users.occupation == occupations.title;
