CREATE TABLE movies1(
id INTEGER PRIMARY KEY AUTOINCREMENT,
title TEXT,
year INTEGER
);

CREATE TABLE genres(
id INTEGER PRIMARY KEY AUTOINCREMENT,
title TEXT
);

CREATE TABLE genres_for_movies(
id INTEGER PRIMARY KEY AUTOINCREMENT,
movie_id INTEGER,
genre_id INTEGER,
FOREIGN KEY(movie_id) REFERENCES movies(id) ON DELETE CASCADE,
FOREIGN KEY(genre_id) REFERENCES genres(id) ON DELETE CASCADE
);

CREATE TABLE users1(
id INTEGER PRIMARY KEY AUTOINCREMENT,
name TEXT,
surname TEXT,
email TEXT UNIQUE,
gender TEXT CHECK(gender == "male" OR gender == "female"),
register_date TEXT,
occupation_id INTEGER,
FOREIGN KEY(occupation_id) REFERENCES occupations(id) ON DELETE CASCADE
);

CREATE TABLE occupations(
id INTEGER PRIMARY KEY AUTOINCREMENT,
title TEXT
);

CREATE TABLE tag(
id INTEGER PRIMARY KEY AUTOINCREMENT,
title TEXT
);

CREATE TABLE tags1(
id INTEGER PRIMARY KEY AUTOINCREMENT,
user_id INTEGER,
movie_id INTEGER,
tag_id INTEGER,
timestamp INTEGER,
FOREIGN KEY(user_id) REFERENCES users(id) ON DELETE CASCADE,
FOREIGN KEY(movie_id) REFERENCES movies(id) ON DELETE CASCADE,
FOREIGN KEY(tag_id) REFERENCES tags(id) ON DELETE CASCADE
);

CREATE TABLE ratings1(
id INTEGER PRIMARY KEY AUTOINCREMENT,
user_id INTEGER,
movie_id INTEGER,
rating REAL CHECK(rating >= 0.0 AND rating <= 5.0),
timestamp INTEGER,
FOREIGN KEY(user_id) REFERENCES users(id) ON DELETE CASCADE,
FOREIGN KEY(movie_id) REFERENCES movies(id) ON DELETE RESTRICT
);


WITH RECURSIVE allGenres(genres, str) AS (SELECT '', movies.genres || '|' FROM movies UNION ALL SELECT substr(str, 0, instr(str, '|')), substr(genres, instr(genres, '|')+1) FROM allGenres WHERE str != '')


